import React from 'react';
import "./footer.css";
const emailjs = require("emailjs-com");

function Footer() {
  function SendEmail(e) {
    e.preventDefault();

    emailjs.sendForm('service_ta5wljc', 'template_yawjug2', e.target, 'user_3XCPZAVZVJWypzx2KXKNS')
      .then((result) => {
        console.log(result.text);
      }, (error) => {
        console.log(error.text);
      });
  }

  return ( <
    form className = "contact-form"
    onSubmit = {
      SendEmail
    } >
    <
    input type = "hidden"
    name = "contact_number" / >
    <
    label > Name < /label> <
    input type = "text"
    name = "user_name" / >
    <
    label > Email < /label> <
    input type = "email"
    name = "user_email" / >
    <
    label > Message < /label> <
    textarea name = "message" / >
    <
    input type = "submit"
    value = "Send" / >
    <
    /form>
  );
}




